import React  from "react"
import "./table.css"




const Table = (props) => <div id={props.title} className="main">
    <h1 className="title"> {props.tableName} </h1>
    <table>
        <tr>
            <th> # </th>
            {

                props.header.map(val => <th> {val} </th>)
            }
        </tr>
        {
            props.details.map((row, pos) => 
                <tr>
                    <td>  {pos+1}            </td>
                    {
                        ["Company","Designation", "StartDate", "EndDate"]
                        .map(val => <td> { row[val]} </td>)
                    }
                </tr>
            )
        }
    </table>
</div>

export default Table;
